// Zach

import React, { useState } from 'react';

export default function CreateCustomer() {
    const [firstName, setFirstName] = useState('');
    const [lastName, setLastName] = useState('');
    const [address, setAddress] = useState('');
    const [email, setEmail] = useState('');
    const [phone, setPhone] = useState('');
    const [selectedRole, setSelectedRole] = useState('');
    const [confirmation, setConfirmation] = useState(false);
    const [confirmedFirstName, setConfirmedFirstName] = useState('');
    const [confirmedLastName, setConfirmedLastName] = useState('');

    const handleRoleChange = (role) => {
        setSelectedRole(role);
    };

    const handleSubmit = () => {
        if (firstName && lastName && address && email && phone && selectedRole) {
            setConfirmedFirstName(firstName);
            setConfirmedLastName(lastName);
            setConfirmation(true);
            setTimeout(() => {
                setConfirmation(false);
            }, 3000);

            // Clear input fields
            setFirstName('');
            setLastName('');
            setAddress('');
            setEmail('');
            setPhone('');
            setSelectedRole('');
        } else {
            alert('Please fill in all fields and select a role.');
        }
    };

    return (
        <div style={styles.container}>
            <h1>Create New Customer</h1>
            <div style={styles.formGroup}>
                <label htmlFor="firstName">First Name</label>
                <input
                    type="text"
                    id="firstName"
                    placeholder="First Name"
                    value={firstName}
                    onChange={(e) => setFirstName(e.target.value)}
                    style={styles.input}
                />
            </div>
            <div style={styles.formGroup}>
                <label htmlFor="lastName">Last Name</label>
                <input
                    type="text"
                    id="lastName"
                    placeholder="Last Name"
                    value={lastName}
                    onChange={(e) => setLastName(e.target.value)}
                    style={styles.input}
                />
            </div>
            <div style={styles.formGroup}>
                <label htmlFor="address">Address</label>
                <input
                    type="text"
                    id="address"
                    placeholder="Address"
                    value={address}
                    onChange={(e) => setAddress(e.target.value)}
                    style={styles.input}
                />
            </div>
            <div style={styles.formGroup}>
                <label htmlFor="email">Email</label>
                <input
                    type="text"
                    id="email"
                    placeholder="Email"
                    value={email}
                    onChange={(e) => setEmail(e.target.value)}
                    style={styles.input}
                />
            </div>
            <div style={styles.formGroup}>
                <label htmlFor="phone">Phone</label>
                <input
                    type="text"
                    id="phone"
                    placeholder="Phone"
                    value={phone}
                    onChange={(e) => setPhone(e.target.value)}
                    style={styles.input}
                />
            </div>
            <div style={styles.roles}>
                <button
                    className={selectedRole === 'customer' ? 'selected' : ''}
                    onClick={() => handleRoleChange('customer')}
                    style={{ ...styles.button, ...(selectedRole === 'customer' ? styles.selectedButton : {}) }}
                >
                    Customer
                </button>
                <button
                    className={selectedRole === 'employee' ? 'selected' : ''}
                    onClick={() => handleRoleChange('employee')}
                    style={{ ...styles.button, ...(selectedRole === 'employee' ? styles.selectedButton : {}) }}
                >
                    Employee
                </button>
                <button
                    className={selectedRole === 'administrator' ? 'selected' : ''}
                    onClick={() => handleRoleChange('administrator')}
                    style={{ ...styles.button, ...(selectedRole === 'administrator' ? styles.selectedButton : {}) }}
                >
                    Administrator
                </button>
            </div>

            <button
                onClick={handleSubmit}
                style={styles.submitButton}
            >
                Submit
            </button>
            {confirmation && (
                <div className="confirmation" style={styles.confirmation}>
                    {`Customer ${confirmedFirstName} ${confirmedLastName} created successfully!`}
                </div>
            )}
        </div>
    );
}

const styles = {
    container: {
        padding: '20px',
    },
    formGroup: {
        marginBottom: '15px',
    },
    input: {
        width: '100%',
        padding: '10px',
        marginBottom: '10px',
        border: '1px solid #ccc',
        borderRadius: '4px',
        fontFamily: 'Arial, sans-serif',
        boxSizing: 'border-box',
    },
    roles: {
        display: 'flex',
        justifyContent: 'space-between',
        marginBottom: '15px',
    },
    button: {
        flex: '1',
        padding: '10px',
        marginRight: '5px',
        backgroundColor: '#f0f0f0',
        border: '1px solid #ccc',
        cursor: 'pointer',
        fontFamily: 'Arial, sans-serif',
        textAlign: 'center',
    },
    selectedButton: {
        backgroundColor: '#007bff',
        color: 'white',
    },
    submitButton: {
        width: '100%',
        padding: '10px',
        backgroundColor: '#007bff',
        color: 'white',
        border: 'none',
        borderRadius: '4px',
        cursor: 'pointer',
        fontFamily: 'Arial, sans-serif',
        transition: 'background-color 0.3s ease',
    },
    buttonHover: {
        backgroundColor: '#0056b3',
    },
    confirmation: {
        padding: '10px',
        backgroundColor: '#d4edda',
        color: '#155724',
        marginTop: '20px',
        border: '1px solid #c3e6cb',
    },
};
